  console.log(location);
  const [info, setInfo] = useState({
    name: '',
    addr: '',
    main_menu: ''
  });

  useEffect(() => {
    axios
      .get(url)
      .then(result => console.log(result))
      .catch(e => console.log(e));
  });

  return <div>This is RestaurantResult</div>;
};

export default RestaurantResult;
